import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import PrivateRoute from './PrivateRoute'

import {UserMenu, AddCustomer, ViewCustomers, AddJob, ViewJobs, LoginForm} from './Pages/'
//import UserMenu from './UserMenu';
//import AddCustomer from './AddCustomer';
//import ViewCustomers from './ViewCustomers';
//import ViewJobs from './ViewJobs';
//import LoginForm from './LoginForm';

class App extends React.Component {
    render() {
        return (
            <div>
                <Router>
                    <div>
                        <PrivateRoute exact path="/" component={UserMenu} />
                        <Route path="/menu" component={UserMenu} />
                        <Route path="/login" component={LoginForm} />                        
                        <Route path="/AddCustomer" component={AddCustomer} />
                        <Route path="/customers" component={ViewCustomers} />
                        <Route path="/jobs" component={ViewJobs}/>
                    </div>
                </Router>
            </div>
        );
    }
}

export default App ;
